import './contact.css'



function Contact() {
    return (
            
        
         
          <div>
            <p>AJA Global Locations</p>
            <h1>INDIA</h1>
            <p>Aja Consulting Services LLP
                9th Floor, Block B, MJR Magnifique, 
                Raidurgam, Prashant Hills, Hyderabad, 
                Telangana 500008</p>
            <h1>USA</h1>
            <p>Aja Consulting Services INC
                838 Garden Street, Milpitas 95035 CA</p>
          </div>
          
         
      
    );
  }
  
  export default Contact;
